import "./App.css";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import Header from "./app/CommonComponents/Header";
import Footer from "./app/CommonComponents/Footer";
function App() {
  return (
    <Router>
      <Header />
      <Route>
        <Route path="/notfound" element={<NotFound />} />
      </Route>
      <Footer />
    </Router>
  );
}

export default App;
